import React from 'react';
import './Fieldset.scss';
import {Input} from "./Input"
import {Label} from "./Label"
import {Legend} from "./Legend"

class Fieldset extends React.Component {
  constructor(props) {
    super (props);
  }

  render () {
    return (
        <fieldset className="app-exchanger">
            <Legend >Enter currency in {this.props.legend}</Legend>
            <Label currency={this.props.currency}></Label>
            <label for={this.props.currency}>{this.props.currency}</label>
            <Input currency={this.props.currency}></Input>
        </fieldset>
    );
  }
}


export {Fieldset};
